import { configureStore } from '@reduxjs/toolkit'
import  clientReducer  from "./clientSlice";
import moduleReducer from "./moduleSlice"



export const store = configureStore({
  reducer: {
    client: clientReducer,
    module: moduleReducer,
  }
})
